import { BrowserRouter, Routes, Route } from 'react-router-dom'
import ContextWrapper from '../context/ContextWrapper'
import Home from '../pages/Home'

const AppLayout = () => {
    return (
        <ContextWrapper>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Home />} />
                </Routes>
            </BrowserRouter>
        </ContextWrapper>
    )
}

export default AppLayout;
